import React from 'react';
import CharacterCard from './characterCard';

const styleCharactersList = {
    flexDirection: 'flex',
    textAlign: 'center',
    padding: '2vw',
    justifyContent: 'space-evenly'
};

const CharacterList = ({ pokemons, onClick }) => (
    <div style={styleCharactersList} >
        {pokemons.map(({ imageUrl, name, id }) => (
            <CharacterCard
            name={name}
            imageUrl={imageUrl}
            onClick={() => onClick(id)}
            ></CharacterCard>
        ))}
    </div>
);

export default CharacterList;
